(def pathbuilder-include "../pathbuilder/pathbuilder.scad")

(defn svg-shape [path-string]
  (call-module :svgShape (format "\"%s\"" path-string))
  )

(defn svg-points [path-string]
  (call :svgPoints (format "\"%s\"" path-string))
  )

